print(f"Direct members API response status: {api_response_direct.status_code}")

if api_response_direct.status_code == 200:
    direct_members = api_response_direct.json()
    print(f"\nFound {len(direct_members)} direct project members:")
    for member in direct_members:
        print(f"  - {member.get('name')} (ID: {member.get('id')}, username: {member.get('username')}, access_level: {member.get('access_level')})")

    # Access levels in GitLab:
    # 10 = Guest, 20 = Reporter, 30 = Developer, 40 = Maintainer, 50 = Owner
    # Infrastructure admins would typically be Owners (50)

    # Identify members to remove (non-owners)
    members_to_remove = [m for m in direct_members if m.get('access_level') < 50]
    print(f"\nMembers to remove (non-owners): {len(members_to_remove)}")
    for member in members_to_remove:
        print(f"  - {member.get('name')} (username: {member.get('username')}, access_level: {member.get('access_level')})")
else:
    print(f"API response: {api_response_direct.text[:500]}")"}

